he change in Km (Michaelis-Menten constant) is parallel to the alteration in Kd. Any given competitive inhibitor concentration can be overcome by increasing the substrate concentration in which case the substrate will outcompete the inhibitor in binding to the enzyme.\ncreated_by_user_id: \n- 1\n- 3\ncreated_at: \n- \n- *id001\n','2007-06-06 17:01:06'),(78,2,'ParameterType',3,NULL,NULL,'update','--- \nupdated_at: \n- 2007-06-06 16:59:17 Z\n- 2007-06-06 17:02:49.240110 Z\nlock_version: \n- 0\n- 1\ndescription: \n- Count\n- This is generic parameter type for animal counts and other such totals\n','2007-06-06 17:02:49'),(79,4,'ParameterType',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- Identifier\nstorage_unit: \n- \n- \"\"\nupdated_at: \n- \n- &id001 2007-06-06 17:04:24.759261 Z\ndata_type_id: \n- \n- 1\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 4\ndescription: \n- \"\"\n- In the case of non managed inventories this provide a reference text or barcode used for identification\ncreated_by_user_id: \n- 1\n- 3\ncreated_at: \n- \n- *id001\n','2007-06-06 17:04:24'),(80,5,'ParameterType',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- Compound\nstorage_unit: \n- \n- \"\"\nupdated_at: \n- \n- &id001 2007-06-06 17:05:07.444616 Z\ndata_type_id: \n- \n- 5\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 5\ndescription: \n- \"\"\n- Lookup of a compound reference, dictionary driven\ncreated_by_user_id: \n- 1\n- 3\ncreated_at: \n- \n- *id001\n','2007-06-06 17:05:07'),(81,6,'ParameterType',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- Plate\nstorage_unit: \n- \n- \"\"\nupdated_at: \n- \n- &id001 2007-06-06 17:05:46.893830 Z\ndata_type_id: \n- \n- 5\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 6\ndescription: \n- \"\"\n- \"Plate reference, lookup based Plate Id \"\ncreated_by_user_id: \n- 1\n- 3\ncreated_at: \n- \n- *id001\n','2007-06-06 17:05:46'),(82,7,'ParameterType',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- Subject\nstorage_unit: \n- \n- \"\"\nupdated_at: \n- \n- &id001 2007-06-