 1\ncurrent_process_id: \n- \n- 2\n','2007-06-06 22:17:24'),(236,12,'ParameterType',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- IC50\nstorage_unit: \n- \n- concentration\nupdated_at: \n- \n- &id001 2007-06-06 22:22:07.995160 Z\ndata_type_id: \n- \n- 2\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 12\ndescription: \n- \"\"\n- |-\n  IC50 is a measure of concentration used in pharmacological research. IC50, or the half maximal inhibitory concentration, represents the concentration of an inhibitor that is required for 50% inhibition of its target (i.e. an enzyme, cell, cell receptor or a microorganism). In simpler terms, it measures how much of a particular substance/molecule is needed to inhibit some biological process by 50%.\r\n  \r\n  IC50 is commonly used as a measure of drug affinity. A measure of drug efficacy is EC50 which represents the concentration of a compound that is required to obtain 50% of the maximum effect in vivo. (Ex. EC99 would be the minimum concentration of a compound to obtain 99% of its effect). For competition binding assays and functional antagonist assays IC50 is the most common summary measure of the dose-response curve. For agonist/stimulator assays the most common summary measure is the EC50. (http://www.ncgc.nih.gov/guidance/section3.html)\r\n  \r\n  According to the FDA, IC50 represents the concentration of a drug that is required for 50% inhibition in vitro whereas EC50 represents the plasma concentration required for obtaining 50% of a maximum effect in vivo.(http://www.fda.gov/ohrms/dockets/ac/00/slides/3621s1d/sld036.htm)\r\n  \r\n  IC50 values are dependent on conditions under which they are measured. For example for enzymes, IC50 value increases as enzyme concentration increases. Furthermore depending on the type of inhibition other factors may influence IC50 value; for ATP dependent enzymes IC50 value has an interdependency with concentration of ATP, especially so if inhibition is all of it competitive.\ncreated_by_user_id: \n- 1\n- 3\ncreated_at: \n- \n- *id001\n','2007-06-06 22:22:08'),(237,13,'ParameterType',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- Enzyme\nstorage_unit: \n- \n- \"\"\nupdated_at: \n- \n- &id001 2007-06-06 22:27:29.686191 Z\ndata_type_id: \n- \n- 1\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 13\ndescription: \n- \"\"\n- Enzymes are proteins that catalyze (i.e. accelerate) chemical reactions.[1] In enzymatic reactions, the molecules at the beginning of the process are called substrates, and the enzyme converts them into different molecules, the products. Almost all processes in a biological cell need enzymes in order to occur at significant rates. Since enzymes are extremely selective for their substrates and speed up only a few reactions from among many possibilities, the set of enzymes made in a cell determines which metabolic pathways occur in that cell.\ncreated_by_user_id: \n- 1\n- 3\ncreated_at: \n- \n- *id001\n','2007-06-06 22:27:29'),(238,14,'ParameterType',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- organism\nstorage_unit: \n- \n- \"\"\nupdated_at: \n- \n- &id001 2007-06-06 22:29:09.357852 Z\ndata_type_id: \n- \n- 1\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 14\ndescription: \n- \"\"\n- |-\n  n biology and ecology, an organism (in Greek organon = instrument) is a living complex adaptive system of organs that influence each other in such a way that they function in some way as a stable whole.\r\n  \r\n  The origin of life on Earth and the relationships between its major lineages are controversial. Two main grades may be distinguished, the prokaryotes and eukaryotes. The prokaryotes are generally considered to represent two separate domains, called the Bacteria and Archaea, which are not closer to one another than to the eukaryotes. The gap between prokaryotes and eukaryotes is widely considered a major missing link in evolutionary history. Two eukaryotic organelles, namely mitochondria and chloroplasts, are generally considered to be derived from endosymbiotic bacteria. Fungi, animals and plants are examples of species that are eukaryote. Organisms all go through a life cycle.\r\n  \r\n  The phrase complex organism describes any organism with more than one cell.\ncreated_by_user_id: \n- 1\n- 3\ncreated_at: \n- \n- *id001\n','2007-06-06 22:29:09'),(239,15,'ParameterType',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- Location\nstorage_unit: \n- \n- \"\"\nupdated_at: \n- \n- &id001 2007-06-06 22:29:40.601682 Z\ndata_type_id: \n- \n- 1\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 15\ndescription: \n- \"\"\n- Location of a object\ncreated_by_user_id: \n- 1\n- 3\ncreated_at: \n- \n- *id001\n','2007-06-06 22:29:40'),(240,3,'DataConcept',3,NULL,NULL,'update','--- \nupdated_at: \n- 2006-09-06 19:35:22 Z\n- 2007-06-07 09:46:08.029603 Z\nupdated_by_user_id: \n- 1\n- 3\nlock_version: \n- 1\n- 2\ndescription: \n- Study\n- Short lookup dictionaries and other internal used combo in study,protocol, and experiment forms.\n','2007-06-07 09:46:08'),(241,9,'ProjectElement',3,NULL,NULL,'create','--- \nname: \n- \"\"\n- Demo1\nproject_id: \n- \n- 13\nupdated_at: \n- \n- &id001 2007-06-07 14:37:26.983213 Z\ntype: \n- ProjectElement\n- ProjectFolder\nupdated_by_user_id: \n- 1\n- 3\nid: \n- \n- 9\nreference_type: \n- \n- Study\nreference_id: \n- \n- 1\ncreated_by_user_id: \n- 1\n- 3\nparent_id: \n- \n- 5\ncreated_at: \n- \n- *id001\n','2007-06-07 14:37:26'),(242,9,'ProjectElement',3,NULL,NULL,'update','--- \nupdated_at: \n- 2007-06-07 14:37:26.983213 Z\n- 2007-06-07 14:37:27.091678 Z\nlock_version: \n- 0\n- 1\n','2007-06-07 14:37:27'),(243,1,'StudyQueue',3,NULL,NULL,'update','--- \nname: \n- Todo\n- PrimaryScreen\nupdated_at: \n- 2007-06-06 20:31:48 Z\n- 2007-06-07 14:38:20.076918 Z\nlock_version: \n- 1\n- 2\n','2007-06-07 14:38:20'),(244,17,'StudyParameter',3,NULL,NULL,'create','--- \nname: \n- \n- IC50\ndefault_value: \n- \n- \"\"\ndisplay_unit: \n- \n- mM\nparameter_role_id: \n- \n- 2\nparameter_type_id: \n- \n- 12\ndata_format_id: \n- \