INSERT INTO `data_concepts` VALUES (1,NULL,'BioRails',1,'This is the main <strong>context </strong>or<strong> conceptual name space </strong>for all key <strong>concepts </strong>in the core BioRails application. The context is divided into a logical tree of concepts.&nbsp; These concepts can be extended with child concepts providing&nbsp; the possibility of <strong>value lookup lists</strong> defined against each concept. In-use concepts<strong> </strong>are linked to <strong>parameter types </strong>at the global catalogue level. Parameter types are then implemented as <strong>study parameters</strong> and a linked lookup <strong>element </strong>may be used.<br />\r\n<br />\r\nThis structure provides a solid division of control between global warehousing need and local terminology, put more simply, the scientists can maintain their own (often unique) terminologies which can be mapped into the corporate dictionaries.',NULL,3,'2007-01-22 15:23:29','2007-01-23 20:54:17','DataContext',1,1),(2,1,'Subject',1,'Subject',NULL,1,'2006-09-06 19:33:33','2006-09-06 19:33:33','DataConcept',1,1),(3,1,'Catalogue',1,'Short lookup dictionaries and other internal used combo in study,protocol, and experiment forms.',NULL,2,'2006-09-06 19:35:22','2007-06-07 09:46:08','DataConcept',3,1),(4,1,'Organization',1,'Oganizational Structure (Projects, studies etc)',NULL,5,'2006-09-06 19:35:33','2006-10-09 16:01:50','DataConcept',1,1),(6,2,'Compounds',1,'Compounds',NULL,1,'2006-09-06 19:35:50','2006-09-06 19:35:51','DataConcept',1,1),(7,2,'Batches',1,'Batch',NULL,2,'2006-09-06 19:36:00','2007-01-19 15:37:11','DataConcept',1,1),(8,2,'Plate',1,'Plate',NULL,1,'2006-09-06 19:36:07','2006-09-06 19:36:07','DataConcept',1,1),(9,2,'Treatment',1,'Treatment Groups',NULL,1,'2006-09-06 19:36:13','2006-09-06 19:36:13','DataConcept',1,1),(10,2,'Specimens',1,'Specimens',NULL,1,'2006-09-06 19:36:24','2006-09-06 19:36:24','DataConcept',1,1),(11,2,'Lists',1,'List, Libraries',NULL,2,'2006-09-06 19:36:32','2006-0