INSERT INTO `data_formats` VALUES (1,'Text','Free Format Text','','.',1,'0000-00-00 00:00:00','2007-02-07 14:10:25',1,1,1,NULL),(2,'Alpha','A-Z',NULL,NULL,0,'0000-00-00 00:00:00','0000-00-00 00:00:00',1,1,1,NULL),(3,'Line','Single Line of Text',NULL,'[^\"\\r\\n]*',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',1,1,1,NULL),(4,'Double','Standard Number format +/-nnn.nnnnn with units','0.0','^[-+]?[0-9]*\\.?[0-9]+[ ,A-z,/,%]*$',6,'2006-11-27 11:59:22','2007-06-07 21:45:34',2,3,1,'%d %s'),(7,'Scientific Notation','Scientific Notation',NULL,'[-+]?[0-9]*\\.?[0-9]+([eE][-+]?[0-9]+)?',0,'0000-00-00 00:00:00','0000-00-00 00:00:00',2,1,1,NULL),(8,'Integer','Integer Value','','[-+]?\\b\\d+\\b',3,'0000-00-00 00:00:00','2007-06-07 21:45:05',2,3,1,'%d'),(11,'Positive','Description:  	Positive integer value.\r\nMatches: 	123|||10|||54\r\nNon-Matches: 	-54|||54.234|||abc','','^[0-9,.]*$',1,'0000-00-00 00:00:00','2007-05-31 14:18:52',2,3,1,''),(12,'Decimal5.2','Description:  	validates to 5 digits and 2 decimal places but not allowing zero','','(?!^0*$)(?!^0*\\.0*$)^\\d{1,5}(\\.\\d{1,2})?$',2,'0000-00-00 00:00:00','2007-06-06 20:13:07',2,3,1,'%5.2d'),(13,'Percentage','Description:  	Percentage (From 0 to 100)\r\n','','[-+]?[0-9]*\\.?[0-9]',1,'0000-00-00 00:00:00','2007-06-06 20:26:16',2,3,1,'%d'),(24,'URL','Description:  	I wrote this after I couldn\'t find an expression that would search for valid URLs, whether they had HTTP in front or not. This will find those that don\'t have hyphens anywhere in them (except for after the domain).\r\nMatches: 	http://www.google.com|||www.123google.com|||www.google.com/help/me\r\nNon-Matches: 	-123google.com|||http://-123.123google.com\r\n ','','(http://)[a..Z]*',1,'0000-00-00 00:00:00','2007-05-25 19:08:50',6,3,1,NULL),(25,'Name','Name without spaces','','^[A-Z,a-z,0-9]*$',1,'2007-05-25 21:07:28','2007-05-28 15:02:59',3,3,3,''),(26,'Quantiy','Basic numeric value followed by a unit','','^[-+]?[0-9]*\\.?[0-9]+[ ,A-z,/,%]*$',0,'2007-06-06 20:15:15','2007-06-06 20:15:15',2,3,3,'%d %s'),(27,'Concentration','Concentration in molar units','','^[-+]?[0-9]*\\.?[0-9]* ?[m,u,u,p]?M?$',1,'2007-06-06 20:20:26','2007-06-08 11:24:56',2,3,3,'%d %s'),(28,'Amount','Mols of stuff ','','^[-+]?[0-9]*\\.?[0-9] ?[(m,u,n,p)]mol$',0,'2007-06-06 20:22:12','2007-06-06 20:22:12',2,3,3,'%d %s');
